import React from "react";
import "./styles.scss";

export function Description() {
  return (
    <div className="container">
      <img
        src={require("../../assets/images/sp3.png")}
        alt=""
        className="container--img"
      />
      <h1 className="container--title">
        {"Find your passion andachieve success"}
      </h1>
      <p className="container--description">
        {
          "find a job that suits your interests and talents. A high salary is not the top priority. Most importantly, You can work according to your heart's desire."
        }
      </p>

      <h1 className="container--title__2">
        {"Find your passion andachieve success"}
      </h1>
      <p className="container--description__2">
        {
          "find a job that suits your interests and talents. A high salary is not the top priority. Most importantly, You can work according to your heart's desire."
        }
      </p>
      <img
        src={require("../../assets/images/sp4.png")}
        alt=""
        className="container--img"
      />
    </div>
  );
}
